import React, { useEffect, useState } from 'react';

const Dashboard = () => {
  const [commissionData, setCommissionData] = useState(null);
  const [violationsData, setViolationsData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const email = localStorage.getItem('userEmail');
      if (!email) return;

      try {
        const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${email}`);
        const data = await response.json();

        if (data.success) {
          setCommissionData(data.commissionData);
          setViolationsData(data.violationsData);
        } else {
          alert(data.message || "Failed to fetch agent data");
        }
      } catch (error) {
        console.error("Fetch error:", error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>Dashboard</h1>

      <h2>Weekly Commission</h2>
      {commissionData ? (
        <pre>{JSON.stringify(commissionData, null, 2)}</pre>
      ) : (
        <p>Loading commission data...</p>
      )}

      <h2>Scanning Violations & ARs</h2>
      {violationsData ? (
        <pre>{JSON.stringify(violationsData, null, 2)}</pre>
      ) : (
        <p>Loading violations data...</p>
      )}
    </div>
  );
};

export default Dashboard;
